import React, { useState } from 'react';
import {
    Container, Typography, Box, Button, TextField, LinearProgress, Dialog,
    DialogActions, DialogContent, DialogTitle, IconButton, MenuItem, Select, InputLabel,
    FormControl, Snackbar, Alert
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import { uploadFile, loadData } from './api'; // Import your API functions

const UploadDataPage = ({ open, onClose }) => {
    const [file, setFile] = useState(null);
    const [uploading, setUploading] = useState(false);
    const [uploadProgress, setUploadProgress] = useState(0);
    const [url, setUrl] = useState('');
    const [source, setSource] = useState('');
    const [snackbarOpen, setSnackbarOpen] = useState(false);
    const [snackbarMessage, setSnackbarMessage] = useState('');
    const [snackbarSeverity, setSnackbarSeverity] = useState('success'); // 'success' or 'error'
    const [fileName, setFileName] = useState('Select File'); // New state for file name

    const handleFileChange = (e) => {
        if (e.target.files.length > 0) {
            setFile(e.target.files[0]);
            setFileName(e.target.files[0].name); // Update the file name state
        }
    };

    const handleUrlChange = (e) => {
        setUrl(e.target.value);
    };

    const handleSourceChange = (e) => {
        setSource(e.target.value);
    };

    const handleCloseSnackbar = () => {
        setSnackbarOpen(false);
    };

    const handleUpload = async () => {
        setUploading(true);

        try {
            if (file) {
                // Upload file
                const filename = await uploadFile(file);
                setSnackbarMessage(`File uploaded successfully: ${filename}`);
                setSnackbarSeverity('success');
            }

            if (url) {
                // Load data from URL
                await loadData(url);
                setSnackbarMessage('Data loaded successfully from URL.');
                setSnackbarSeverity('success');
            }

            // Close dialog on successful upload
            onClose();
        } catch (error) {
            setSnackbarMessage('Error uploading file or URL.');
            setSnackbarSeverity('error');
        } finally {
            setUploading(false);
        }
    };

    return (
        <>
            <Dialog
                open={open}
                onClose={onClose}
                maxWidth="sm"
                fullWidth
            >
                <DialogTitle>
                    Upload New Data
                    <IconButton
                        edge="end"
                        color="inherit"
                        onClick={onClose}
                        aria-label="close"
                        sx={{ position: 'absolute', right: 8, top: 8 }}
                    >
                        <CloseIcon />
                    </IconButton>
                </DialogTitle>
                <DialogContent>
                    <Box sx={{ mb: 2 }}>
                        <TextField
                            label="URL (optional)"
                            variant="outlined"
                            fullWidth
                            value={url}
                            onChange={handleUrlChange}
                            sx={{ mb: 2 }}
                        />
                        <FormControl fullWidth variant="outlined" sx={{ mb: 2 }}>
                            <InputLabel>Source</InputLabel>
                            <Select
                                value={source}
                                onChange={handleSourceChange}
                                label="Source"
                            >
                                <MenuItem value="Website">Website</MenuItem>
                                <MenuItem value="Notion">Notion</MenuItem>
                                <MenuItem value="Confluence">Confluence</MenuItem>
                                <MenuItem value="Document">Document</MenuItem>
                            </Select>
                        </FormControl>
                        <Box sx={{ mb: 2 }}>
                            <Button
                                variant="contained"
                                component="label"
                                sx={{ 
                                    width: '100%', 
                                    textAlign: 'left', 
                                    display: 'flex', 
                                    justifyContent: 'flex-start',
                                    overflow: 'hidden',
                                    whiteSpace: 'nowrap',
                                    textOverflow: 'ellipsis'
                                }}
                            >
                                {file ? fileName : 'Select File'} {/* Display file name if selected */}
                                <input
                                    type="file"
                                    hidden
                                    onChange={handleFileChange}
                                    accept=".csv,.json" // Adjust as needed
                                />
                            </Button>
                        </Box>
                    </Box>
                </DialogContent>
                <DialogActions>
                    <Button
                        variant="contained"
                        color="primary"
                        onClick={handleUpload}
                        disabled={uploading}
                    >
                        Upload
                    </Button>
                </DialogActions>
                {uploading && <LinearProgress sx={{ mt: 2 }} variant="determinate" value={uploadProgress} />}
            </Dialog>

            <Snackbar
                open={snackbarOpen}
                autoHideDuration={6000}
                onClose={handleCloseSnackbar}
                action={
                    <IconButton
                        size="small"
                        aria-label="close"
                        color="inherit"
                        onClick={handleCloseSnackbar}
                    >
                        <CloseIcon fontSize="small" />
                    </IconButton>
                }
            >
                <Alert
                    onClose={handleCloseSnackbar}
                    severity={snackbarSeverity}
                    sx={{ width: '100%' }}
                >
                    {snackbarMessage}
                </Alert>
            </Snackbar>
        </>
    );
};

export default UploadDataPage;
